import React, { useState, useEffect } from 'react';
import { auditService } from '../../services/auditService';
import { Card, CardBody, CardHeader } from '../../components/common/Card';
import { LoadingPage } from '../../components/common/Loading';
import { FileText, CheckCircle, List } from 'lucide-react';

const TemplatesPage = () => {
  const [templates, setTemplates] = useState([]);
  const [selected, setSelected] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadTemplates();
  }, []);

  const loadTemplates = async () => {
    try {
      const result = await auditService.getTemplates();
      setTemplates(result.results || result);
    } catch (err) {
      console.error('Error:', err);
    } finally {
      setLoading(false);
    }
  };

  const loadTemplate = async (id) => {
    try {
      const result = await auditService.getTemplate(id);
      setSelected(result);
    } catch (err) {
      console.error('Error:', err);
    }
  };

  if (loading) return <LoadingPage />;

  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Plantillas de Auditoría</h1>
        <p className="text-gray-500">Plantillas disponibles para tus auditorías</p>
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
        {/* Templates List */}
        <div className="space-y-4">
          {templates.map((template) => (
            <Card 
              key={template.id} 
              onClick={() => loadTemplate(template.id)}
              className={`cursor-pointer transition-all ${selected?.id === template.id ? 'ring-2 ring-primary-500' : 'hover:shadow-md'}`}
            >
              <CardBody>
                <div className="flex items-start gap-4">
                  <div className="p-3 bg-primary-100 rounded-xl">
                    <FileText className="text-primary-600" size={24} />
                  </div>
                  <div>
                    <h3 className="font-semibold text-gray-900">{template.name}</h3>
                    <p className="text-sm text-gray-500">{template.code}</p>
                    <div className="flex gap-4 mt-2 text-xs text-gray-400">
                      <span>{template.total_sections} secciones</span>
                      <span>{template.total_questions} preguntas</span>
                    </div>
                  </div>
                </div>
              </CardBody>
            </Card>
          ))}
        </div>

        {/* Template Detail */}
        <div className="lg:col-span-2">
          {selected ? (
            <Card>
              <CardHeader>
                <h2 className="text-xl font-bold">{selected.name}</h2>
                <p className="text-gray-500">{selected.description}</p>
              </CardHeader>
              <CardBody>
                <div className="space-y-6">
                  {selected.sections?.map((section) => (
                    <div key={section.id} className="border border-gray-200 rounded-lg p-4">
                      <div className="flex items-center gap-2 mb-3">
                        <List size={18} className="text-primary-600" />
                        <h3 className="font-semibold">{section.code} - {section.name}</h3>
                        <span className="text-xs text-gray-400">({section.questions?.length || 0} preguntas)</span>
                      </div>
                      <div className="space-y-2 ml-6">
                        {section.questions?.map((q) => (
                          <div key={q.id} className="flex items-start gap-2 text-sm">
                            <CheckCircle size={16} className="text-gray-300 mt-0.5" />
                            <span className="text-gray-600">{q.text}</span>
                          </div>
                        ))}
                      </div>
                    </div>
                  ))}
                </div>
              </CardBody>
            </Card>
          ) : (
            <Card>
              <CardBody className="text-center py-12">
                <FileText size={48} className="text-gray-300 mx-auto mb-4" />
                <p className="text-gray-500">Selecciona una plantilla para ver sus detalles</p>
              </CardBody>
            </Card>
          )}
        </div>
      </div>
    </div>
  );
};

export default TemplatesPage;
